import React from 'react';
import { FlexWrapper, Box } from '@components/wrappers';
import { NavbarData } from './NavbarData';
import styled from 'styled-components';
import { ReactComponent as Logo } from '../../assets/logo.svg';
import { HashLink, SimpleLink } from '../links';
import Button from '@components/Button';

const NavbarStyles = styled.nav`
	width: 100%;
	padding: 20px;
	position: fixed;
	display: flex;
	justify-content: space-between;
	align-items: center;
	background: rgba(0, 0, 0, 0.3);
	backdrop-filter: blur(15px);
	svg {
		width: 180px;
	}
	& > div:first-of-type > a {
		font-size: 16px;
		font-weight: 600;
		margin-left: 25px;
	}
	& > div:last-of-type > a {
		margin-left: 15px;
	}
`;

const Navbar: React.FC = () => {
	return (
		<NavbarStyles>
			<Logo />
			<Box>
				{NavbarData.map(({ to, text }) => (
					<HashLink key={text} to={to}>
						{text}
					</HashLink>
				))}
			</Box>
			<Box>
				<SimpleLink href='https://m.tiptop.io/'>
					<Button variant='primary'>Marketplace</Button>
				</SimpleLink>
				<HashLink to='/reps'>
					<Button>Representatives</Button>
				</HashLink>
			</Box>
		</NavbarStyles>
	);
};

export default Navbar;
